import React, { useState } from 'react'
import Header from './Header'
import Axios from 'axios'

// CSS  
import "./Register.css";
import axios from 'axios';

export default function Register() {
  const [name, setNewName] = useState('');
  const [surname, setsurname] = useState('');
  const [newage, setNewage] = useState('');
  const [newuser, setNewuser] = useState('');
  const [newpass, setNewpass] = useState('');

  const register = () => {
    // Axios.post('http://localhost3002/register', {
    //   name,
    //   surname,  
    //   age: newage,
    //   username: newuser,
    //   password: newpass,
    // })
    //   .then(response => {
    //     console.log(response);
    //   })
    //   .catch(err => { throw err });
  };


  return (<Header title='Register'>
    <form className="register-form">
      <div className="home">
        <div className="inputs">

          <h3>Name:</h3>
          <input type="text" onChange={(e) => { setNewName(e.target.value) }} name="name" />

          <h3>Surname:</h3>
          <input type="text" onChange={(e) => { setsurname(e.target.value) }} name="surname" />

          <h3>Age:</h3>
          <input type="date" onChange={(e) => { setNewage(e.target.value) }} name="age" />

          <h3>Email:</h3>
          <input type="email" onChange={(e) => { setNewuser(e.target.value) }} name="username" />

          <h3>Password:</h3>
          <input type="password" onChange={(e) => { setNewpass(e.target.value) }} name="password" />

          <div className="d-flex justify-between">
            <button type="button" onClick={register} className="button">Register</button>
            <button>Login</button>
          </div>
        </div>
      </div>
    </form>
  </Header>
  )
}
